import React from 'react';
import MoviesCard from '../MoviesCard/MoviesCard';
import './MoviesCardList.css';

function MoviesCardList({ currentPath }) {
  return (
    <div className='movies-card-list'>
      <MoviesCard currentPath={currentPath} />
      <MoviesCard currentPath={currentPath} />
      <MoviesCard currentPath={currentPath} />
      <MoviesCard currentPath={currentPath} />
      <MoviesCard currentPath={currentPath} />
